    Lidar Survey of the Alabama, Mississippi, and Southeast Louisiana Barrier Islands,
    from September 5 to October 11, 2012 -- Bare Earth Digital Elevation Models",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-10T06:16:01.699772",nt"name": "topographic-lidar-survey-of-the-alabama-mississippi-and-southeast-louisiana-barrier-islands-fro",nt"isopen":
    false,nt"url": null,nt"notes": "A topographic lidar survey was conducted
    from September 5 to October 11, 2012, for the barrier islands of Alabama, Mississippi
    and southeast Louisiana, including the coast near Port Fourchon. Most of the data
    were collected September 5-10, 2012, with a reflight conducted on October 11, 2012,
    to increase point density in some areas. The data were collected at a nominal pulse
    space of 1-meter (m) and processed to identify bare earth elevations. Bare earth
    Digital Elevation Models(DEMs) were generated based on these data. Aero-Metric,
    Inc., was contracted by the U.S. Geological Survey (USGS) to collect and process
    the lidar data. The bare earth DEMs are 32-bit floating point ERDAS Imagine (IMG)
    files with a horizontal spatial resolution of 1-m by 1-m. They are projected to
    UTM zone 15N or 16N NAD83 meters. Their vertical datum is NAVD88 (GEOID12) meters.
    The DEMs are organized on a 2-kilometer (km) by 2-km tiling scheme that covers the
    entire survey area. These lidar data are available to Federal, State and local governments,
    emergency-response officials, resource managers, and the general public.",nt"license_title":
